// src/App.tsx
import React from 'react';
import Navbar from './components/Navbar';
import Header from './components/Header';
import ContentBoxes from './components/ContentBoxes';


const App: React.FC = () => {
    return (
        <div className="flex flex-col min-h-screen">
            <Navbar />
            <Header />
            <ContentBoxes />
            <Footer />
        </div>
    );
};

export default App;
